// SPDX-License-Identifier: MIT
pragma solidity ^0.8.3;

import "@openzeppelin/contracts-upgradeable/token/ERC20/IERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";

// import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
// import "@openzeppelin/contracts/access/Ownable.sol";

contract FairTraderExchangeV2 is OwnableUpgradeable {
    IERC20Upgradeable public token;
    string public name;
    // uint256 public tokenPrice;
    address adminWalletAddress;

    mapping(address => uint256) public stakingBalance;
    // mapping(address => bool) public isStaking;
    mapping(address => uint256) public stakes;

    address[] public stakers;
    Stakeholder[] public stakeholders;

    event TokensPurchased(
        address account,
        address token,
        uint256 amount,
        uint256 rateFtp
    );
    event Staked(
        address indexed user,
        uint256 amount,
        uint256 index,
        uint256 timestamp
    );

    struct Stake {
        uint256 amount;
        uint256 since;
        uint256 stakeStatus;
        address user;
        bool claimable;
    }

    struct Stakeholder {
        address user;
        Stake[] address_stakes;
    }

    modifier handleWithdrawFundsModifier() {
        require(msg.sender == adminWalletAddress);
        _;
    }

    function storeConstructor(
        IERC20Upgradeable _token,
        string memory _name,
        address _adminWalletAddress
    ) public {
        stakeholders.push();
        token = _token;
        name = _name;
        adminWalletAddress = _adminWalletAddress;
    }

    function getBalance() external view returns (uint256) {
        return address(this).balance;
    }

    function exchangeHistoryOfStake() external view returns (Stakeholder[] memory) {
        return stakeholders;
    }

    function _addStakeholder(address staker) internal returns (uint256) {
        stakeholders.push();
        uint256 userIndex = stakeholders.length - 1;
        stakeholders[userIndex].user = staker;
        stakes[staker] = userIndex;
        return userIndex;
    }

    // to set the token price
    // function exchangeTokenPrice(uint256 _tokenPrice) external handleWithdrawFundsModifier() {
    //     tokenPrice = _tokenPrice;
    // }

    function adminWithdraw(address payable recipient) external handleWithdrawFundsModifier() payable {
        recipient.transfer(address(this).balance);
    }

    function adminWithdrawToken() external handleWithdrawFundsModifier() payable {
        token.transfer(adminWalletAddress, token.balanceOf(address(this)));
    }


    // https://stermi.medium.com/how-to-create-an-erc20-token-and-a-solidity-vendor-contract-to-sell-buy-your-own-token-8882808dd905

    // function buyTokens() public payable {
    function buyTokens(uint256 _liveRate) public payable {
        require(msg.value > 0, "Send ETH to buy some tokens");

        // uint256 tokenAmount = msg.value * tokenPrice;
        uint256 tokenAmount = msg.value * _liveRate;

        require(token.balanceOf(address(this)) >= tokenAmount, "Vendor contract has not enough tokens in its balance");

        // Transfer token to the msg.sender
        (bool sent) = token.transfer(msg.sender, tokenAmount);
        require(sent, "Failed to transfer token to user");

        emit TokensPurchased(
            msg.sender,
            address(token),
            tokenAmount,
            // tokenPrice
            _liveRate
        );
    }

    function stakeTokens(uint256 _amount, uint256 status) public {
        // Check that the requested amount of tokens to sell is more than 0
        require(_amount > 0, "Cannot stake nothing");

        // Check that the user's token balance is enough to do the swap
        uint256 userBalance = token.balanceOf(msg.sender);
        require(userBalance >= _amount, "Your balance is lower than the amount of tokens you want to sell");

        uint256 index = stakes[msg.sender];
        if (index == 0) {
            index = _addStakeholder(msg.sender);
        }
        stakingBalance[msg.sender] += _amount;
        // isStaking[msg.sender] = true;

        bool sent = token.transferFrom(msg.sender, address(this), _amount);
        require(sent, "Failed to transfer tokens from user to vendor");

        stakeholders[index].address_stakes.push(
            Stake(_amount, block.timestamp, status, msg.sender, true)
        );
        emit Staked(msg.sender, _amount, index, block.timestamp);
    }

    function _withdrawStake(uint256 index) public {
        uint256 user_index = stakes[msg.sender];
        Stake memory current_stake = stakeholders[user_index].address_stakes[
            index
        ];
        if (current_stake.claimable == true) {
            current_stake.claimable = false;

            uint256 timeDiffrence = block.timestamp - current_stake.since;

            uint256 unstakeAmount = current_stake.amount;

            uint32 ftpPercentage24M;
            uint32 ftpPercentage12M;
            uint32 ftpPercentage06M;

            uint256 incentiveAmount;
            uint256 countIntrest;
            if (current_stake.stakeStatus == 2) {
                ftpPercentage24M = 30;
                ftpPercentage12M = 25;
                ftpPercentage06M = 20;
            } else {
                ftpPercentage24M = 100;
                ftpPercentage12M = 100;
                ftpPercentage06M = 50;
            }

            if (timeDiffrence >= 104 weeks) {
                countIntrest = ((unstakeAmount / 100) * ftpPercentage24M) * 2;
                incentiveAmount = countIntrest + unstakeAmount;
            } else if (timeDiffrence >= 52 weeks) {
                countIntrest = ((unstakeAmount / 100) * ftpPercentage12M);
                incentiveAmount = countIntrest + unstakeAmount;
            } else if (timeDiffrence >= 26 weeks) {
                countIntrest = ((unstakeAmount / 100) * ftpPercentage06M) / 2;
                incentiveAmount = countIntrest + unstakeAmount;
            } else if (timeDiffrence >= 2 minutes) {
                countIntrest = 1000000000000000000;
                incentiveAmount = countIntrest + unstakeAmount;
            } else {
                incentiveAmount = unstakeAmount;
            }

            token.transfer(msg.sender, incentiveAmount);
            stakingBalance[msg.sender] -= current_stake.amount;
        }
    }
}
